import { IonButton, IonButtons, IonCard, IonCol, IonContent, IonGrid, IonHeader, IonIcon, IonInfiniteScroll, IonInfiniteScrollContent, IonInput, IonItem, IonMenuButton, IonPage, IonRow, IonTitle, IonToolbar } from '@ionic/react';
import { add, close, pencil } from 'ionicons/icons';
import { useState, useEffect } from 'react';
import { useHistory, useParams, useRouteMatch } from 'react-router';
import ExploreContainer from '../../components/ExploreContainer';
import Product from './Product';

const data = require('./jm.json');
const ProductList: React.FC = () => {

    const { name } = useParams<{ name: string; }>();

    const [proveedores, setProveedores] = useState<Product[]>([]);

    const history = useHistory();


  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(100);

  const handleChangePage = (event: unknown, newPage: number) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (
    event: React.ChangeEvent<HTMLInputElement>
  ) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };
  interface IProduct {
    code: string;
    description: string;
    price: Number;
  }


    useEffect(() => {
    }, [history.location.pathname]);
    /* 
    const search = async ()=> {
        let result = await searchSuppliers();
        setProveedores(result);

    }
   const remove = async(id:string)=>{
        await removeSupplier(id);
        search();
    }
    const addSupplier = () =>{
        history.push('/page/supplier/new')
    }

    const editSupplier = (id:string)=> {
        history.push('/page/supplier/'+id);
    }
    */
    return (
        <IonPage>
            <IonHeader>
                <IonToolbar>
                    <IonButtons slot="start">
                        <IonMenuButton />
                    </IonButtons>
                    <IonTitle>{name}</IonTitle>
                </IonToolbar>
            </IonHeader>

            <IonContent fullscreen>
                <IonHeader collapse="condense">
                    <IonToolbar>
                        <IonTitle size="large">{name}</IonTitle>
                    </IonToolbar>
                </IonHeader>



                <IonContent>
                        <IonInput>Buscar</IonInput>
                    <IonCard>
                        <IonTitle>Gestion de productos</IonTitle>

                        <IonItem>
                            <IonButton color='primary' fill='solid' slot='end' size='default'>
                                <IonIcon icon={add} />
                                Agregar proveedor
                            </IonButton>
                        </IonItem>

                    <IonInfiniteScroll>
                    <IonInfiniteScrollContent 
        loadingSpinner="bubbles"
        loadingText="Loading more data...">
                        <IonGrid className='table'>
                            <IonRow>
                                <IonCol>Codigo</IonCol>
                                <IonCol>Descripcion</IonCol>
                                <IonCol>Precio</IonCol>
                            </IonRow>

                            {data
                                .map((producto: Product) =>

                                    <IonRow>
                                        <IonCol>{producto.cod} </IonCol>
                                        <IonCol>{producto.description}</IonCol>
                                        <IonCol>{Number(producto.price) * 1.5}</IonCol>

                                    </IonRow>
                                )}

                        </IonGrid>
                    </IonInfiniteScrollContent>
                    </IonInfiniteScroll>
                    </IonCard>
                </IonContent>





            </IonContent>
        </IonPage>
    );
};

export default ProductList;
